query:
		query {
			sessionContactAccount(
			  where: {
				token: "${token}"
			  }
			) {
	id
	name
	documents (orderBy: createdAt_DESC){
	  id
	  isUploadedBySeller
	  mustAccept
	  description
	  name
	  acceptedAt
	  acceptedBy
	  active
	  displayToBuyer
	  uploadedBy
	  createdAt
	  updatedAt
	  file {
		  id
		  url
		  name
	  }
	  comments {
		  id
		  comment
		  madeBy
		  createdAt
		  updatedAt
	  }
	}
  }
		  }
